import Navbar from "../../components/navbar"
import Card from "../../components/card"

const Project = () => {
    return (
        <div>
            <Navbar />
                <h1 className="text-center font-medium text-3xl">My Project</h1>
            <div className="justify-center mt-10 mx-8 sm:mx-8 md:mx-20 flex-wrap sm:flex-wrap md:flex-warp">
                <Card /><Card /><Card /><Card />
            </div>
        </div>
    )
}

export default Project;
